import React, { Component } from 'react';
import logo from './logo.svg';
import API from './API/API';
import './App.css';

class App extends Component {
	constructor() {
		super();
		this.api = new API();
	}

	render() {
		return (
			<React.Fragment>
				<h3>STATBOY</h3>
				<p>{this.api.getData()}</p>
			</React.Fragment>
		);
	}
}

export default App;
